import React from "react";
import { MdApps, MdHome, MdPeople, MdNotifications, MdAccountCircle, MdSettings, MdPowerSettingsNew } from "react-icons/md";

import './Sidenav.css'



export default function Sidenav(){
    return (
        <div className="sidenav--wrapper my-primary-color">
            <ul className="sidenav--header">
                <li className="sidenav-nav-link"><MdHome/></li>
                <li className="sidenav-nav-link"><MdApps/></li>
                <li className="sidenav-nav-link"><MdPeople/></li>
                <li className="sidenav-nav-link"><MdNotifications/></li>
            </ul>
            <div className="sidenav--footer">
                <div className="sidenav-nav-link"><MdAccountCircle/></div>
                <div className="sidenav-nav-link"><MdSettings/></div>
                <div className="sidenav-nav-link"><MdPowerSettingsNew/></div>
            </div>
        </div>
    )
}
